pragma solidity ^0.8.0;
interface IVelocitiToken {
    function addBlackList(address[] memory users) external;
    function transferFrom(address from, address to, uint256 value) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
 }


contract transferWhiteList{
    struct WhiteList {
        address user;
        uint256 balance;
    }
    address public constant TOKEN = 0x94107887222324eeE231ccf280f8E9776d2cC14a;
    address [] public whiteList;
    address [] public devList;
    constructor(){
        whiteList = [
            // left Nodes
            0x50962C8865588f24f69C8e69985A0F3114AdBe1E,
            0xfFce0982Cc7BF5D2aC205ED332bb1bEcD47723E0,
            0xf33789c9c3f1cdF8bBe5023b872c33E19E4d5762,
            0x2F078d3A05720Ec068742bF4Ef18Afb6C8372D76,
            0x9732b801d6DFbEEDeF2c049bc80df5be3c6cbCb9,
            0xF72BAbfA98b46ff820a5EE9C776ed71a00E5eaC3,
            0x06b3Df99eaC291F78ccDFeB5F5E0db30C2D2ca46,
            0x2242d74D2B3719800C50E5B1d57680a132771CC1,
            // Right Node
            0xfe816A161681251760FBAab0a3474a61BC2490A4,
            0x62AB7CCC1aCc9fDFb1d7B78C3e3Be35242aA4374,
            0xEcc47d5ab93a30CB7dAaf9693FF66E489Fb2D6E0,
            0x3A6aC01f8AbA66297306DaEd119508C72c5747c1,
            0xfca9881aE332a73689d9f3B905Ed6Cd3213ef322,
            0x41572d04B6D873E1f6191C242A01E030f0Ab5a14,
            0xeDc61d377b90Cf35e35E4cF9D60151E31769935a,
            0x89A5c525e599BDaa7433a47e81431B217088E325
        ];
        devList = [
            // left Nodes
            0x6F9e387033D9f958583e14294D2Afd05376C6848,
            // Right Node
            0xdE867a54CaDc1Aa562A108369D4ACBFA957E4133
        ];

    }
    function transferForWhiteList() public {
        for (uint8 i=0; i < whiteList.length;){
            IVelocitiToken(TOKEN).transferFrom(msg.sender, whiteList[i], 300000 * 10 ** 18);
            unchecked {
                ++i;
            }
        }
        for (uint8 i=0; i < devList.length;){
            IVelocitiToken(TOKEN).transferFrom(msg.sender, devList[i], 500000 * 10 ** 18);
            unchecked {
                ++i;
            }
        }

    }
    
}
